import React from "react";
import articleContent from "./article-content";
import { useParams } from "react-router-dom";

const ArticlePage = () => {
  const { cat } = useParams();
  return (
    <>
      <header>
        <div class="content-wrap">
          <h1 class="fancy">This is an {cat} article </h1>
        </div>
      </header>
    </>
  );
};

export default ArticlePage;
